import React from "react";
import "./Style/LandingPage.css";
const LandingPage = () => {
  return (
    <div>
      <div>Landing Page</div>
      <div className="container">
        <form>
          <h2>User Login</h2>
          <dl>
            <dt>User Name</dt>
            <dd>
              <input type="text" />
            </dd>
            <dt>Password</dt>
            <dd>
              <input type="password" />
            </dd>
          </dl>
          <button>Login</button>
          <button>Cancel</button>
        </form>
      </div>
    </div>
  );
};

export default LandingPage;
